import React from 'react';
import Card from './Card';
import Dark from './Dark.jpg';
import exc from './exc.jpg';
import Stranger from './Stranger-things.jpg';
import punisher from './punisher.jpg';
import ghoul from './ghoul.jpg';
function Cardsbox()
{
    return(
        <section className="cards-section">
            <div className="container">
              <Card imgSrc={Dark} title="Dark" link="https://www.netflix.com/in/title/80100172"/>
              <Card imgSrc={exc} title="Extra Curricular" link="https://www.netflix.com/in/title/80990668"/>
              <Card imgSrc={Stranger} title="Stranger-things" link="https://www.netflix.com/in/title/80057281"/>
              <Card imgSrc={punisher} title="Punisher" link=""/>
              <Card imgSrc={ghoul} title="Ghoul" link=""/>
            </div>
        </section>
    );
}

export default Cardsbox;
